function Navbar({ signup, signin, signoff }) {
return (
    <div>
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
        <div className="container-fluid">
        <a className="navbar-brand" href="#">
            Navbar
        </a>
            {signin && (
                <div className="nav-item">
                <a className="nav-link active fw-bold fs-5" aria-current="page" href="#">
                    Sign In
                </a>
                </div>
            )}
            {signup && (
                <div className="nav-item">
                <a className="nav-link active fw-bold fs-5" aria-current="page" href="#">
                    Sign Up
                </a>
                </div>
            )}
            {signoff && (
                <div className="nav-item">
                    <a className="nav-link active fw-bold fs-5 p-2" aria-current="page" href="#">
                        Log Out
                    </a>
                </div>
            )}
        </div>
    </nav>
    </div>
);
}

export default Navbar;
